DROP TABLE IF EXISTS `biz_vendor`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `biz_vendor` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'id',
  `item_no` varchar(50) DEFAULT '' COMMENT '货号',
  `color_code` varchar(50) DEFAULT '' COMMENT '色号',
  `vendor_name` varchar(50) DEFAULT '' COMMENT '供应商',
  `vendor_item_no` varchar(50) DEFAULT '' COMMENT '供应商货号',
  `vendor_color_code` varchar(50) DEFAULT '' COMMENT '供应商色号',
  `vendor_region` varchar(50) DEFAULT '' COMMENT '供应商区域',
  `vendor_price` int DEFAULT '0' COMMENT '供应商价格',
  `vendor_cylinder_no` varchar(50) DEFAULT '' COMMENT '缸号',
  `color_difference` varchar(50) DEFAULT '' COMMENT '色差',
  `vendor_gap` varchar(50) DEFAULT '' COMMENT '供应商空差',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_by` varchar(255) DEFAULT '' COMMENT '创建人',
  `update_by` varchar(255) DEFAULT NULL COMMENT '更新人',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `priority` int DEFAULT '0' COMMENT '优先级，越大优先级越高',
  PRIMARY KEY (`id`),
  KEY `idx_vendor_item_no` (`item_no`),
  KEY `idx_vender_color_code` (`color_code`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb3 COMMENT='供应商信息';
